eval("module.exports = [{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"mwnPQOoNKTQ\",\"Date\":\"2007/10/25\",\"Title\":\"Musical Origins: Processing Temporal and Spectral Patterns in Infancy\",\"Keywords\":\"Early Development, Music, Brain, Perception, Auditory Development\",\"Topic\":\"Perception\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Across human societies, music remains a universal experience that all of us - young and old - come to experience. From our youngest days as infants, we are exposed to music through the singing of lullabies or rhythm from \\\"bouncing\\\". In this Distinguished Lecture, Professor Laurel Trainor talks about the origins of music in a developmental sense - how early can humans recognize and learn rhythm and pitch structures, and do specific musical experiences from childhood affect brain development? Various studies are explored, showing that even infants can be sensitive to consonance and dissonance, exhibit the ability to extract rhythmic, or metrical structure, and that the auditory cortex can rapidly mature between the ages of 2-6 months.\",\"Lecturer\":\"Laurel Trainor\",\"Affiliation\":\"McMaster University, Canada\",\"SummaryWordCount\":\"114\",\"Highlights\":\"(~10:24 - 13:36) Rhythm and Movement in Infants --> A humorous look at infants and their rhythm perception using an experiment with bouncing and an ambiguous rhythm (as either duple or triple meter), closing with data that shows that the way an infant is bounced/moved affect what rhythm they perceive/show preference to (for more information on the \\\"ambiguous rhythm\\\" set-up, see 4:33 - 7:35).\",\"\":\"(~1:02:31 - 1:06:00) Effects of Specific Musical Experience on Brain Development --> An extra look into more of Prof. Trainor's work that examines the effect of musical experience on brain development in older children (past infancy). (Note: This was kind of an extra thing she attached to the end of her talk instead of a formal conclusion or wrap-up, so it runs a little longer than 3 min.)\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"8mzQRnWAu2A\",\"Date\":\"2008/01/17\",\"Title\":\"Obstinate systems: Resistance as process in interactive performance\",\"Keywords\":\"interactive music, digital musical instruments, Max/MSP, \",\"Topic\":\"Interaction\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Butch Rovan describes several pieces in which interactive audio systems are designed to resist the performers. The obstinacy of these systems is taken as a creative impetus, and the performer must work withâ€”and againstâ€”them, finding themselves in a collaborative relationship with these computational co-performers, exploring musical and creative terrain where they might not normally find themselves.\",\"Lecturer\":\"Butch Rovan\",\"Affiliation\":\"Brown University, USA\",\"SummaryWordCount\":\"56\",\"Highlights\":\"35:45 - 37:15 (1m30s) Studies in Movement #1\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"GRrElxJkvIc\",\"Date\":\"2008/02/21\",\"Title\":\"Oscillation regimes of musical wind instruments: The points of view of the physicist and the instrumentalistÂ \",\"Keywords\":\"bifurcation schemes, acoustics, clarinet, oscillation regimes, self-sustained oscillations\",\"Topic\":\"Musical Acoustics\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Depending on the musical instrument, it is possible to produce up to 20 different sounds with one single fingering. This relationship between fingering and resulting sound is determined by the oscillation regimes, which is why it is essential for the musician to learn to control them. Dr. Kergomard shows how these regimes apply to wind instruments, particularly the clarinet. Using different models and bifurcation schemes, he investigates the behavior of sound in nonlinear systems. His lecture includes a review of elementary acoustics, results from an experiment that uses an artificial mouth, and even a theoretical explanation of why clarinets squeak.\",\"Lecturer\":\"Jean Kergomard\",\"Affiliation\":\"Laboratoire de MÃ©canique et d'Acoustique, CNRS, France\",\"SummaryWordCount\":\"99\",\"Highlights\":\"18:47-19:10 \\nWatch as an artificial mouth developed in IRCAM (Paris) with latex tubes filled with water is used by Pierre-AndrÃ© Taillard to play the clarinet.\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"D5EJLQlUigM\",\"Date\":\"2009/03/27\",\"Title\":\"Mining for the Meaning of Music\",\"Keywords\":\"rhythm, melody, motif, principal component analysis, beat tracker\",\"Topic\":\"Analysis\",\"ResearchAxis\":\"Music Information Research\",\"Summary\":\"What does the term \\\"music\\\" denote? Can we define music?  As a professor of electrical engineering and leader of the Laboratory for Recognition and Organization of Speech and Audio (LabROSA), Ellis explores large collections of music samples in order to produce â€œa condensed spaceâ€ in which to identify and label musical qualities and provide definitions. His extensive research has encompassed drumbeat rhythms and melody analysis. The aim of his melody research is to provide a dictionary of common motifs (clichÃ©s) in musical melodies. Additionally, Ellis studies the meanings or labels individuals attribute to music, and this research, in turn, has implications as to how music is to be classified.\",\"Lecturer\":\"Dan Ellis\",\"Affiliation\":\"Columbia University, USA\",\"SummaryWordCount\":\"109\",\"Highlights\":\"4:26-5:17 topic of talk: what is denoted by the term \\\"music\\\"? Can we define music\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"VjSMna75fxY\",\"Date\":\"2008/04/17\",\"Title\":\"Sound Actions: Human Movement in the Perception and Cognition of Music\",\"Keywords\":\"Perception, Cognition, Movement, Music Theory, \",\"Topic\":\"Perception\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Movement is everywhere: from walking down the street, to hand gestures while speaking, to a musician's movement during a performance. Regardless of musical training and background, humans are observed to spontaneously generate movements that reflect musical features. In this lecture, Professor Godoy reviews various studies on music and movement and how these findings may influence other areas of music research such as music perception cognition and music theory. By examining the link between music and movement, Prof. Godoy speaks on how human movement plays an integral part in music perception and music cognition in general. The lecture ends with a conclusion of topics, as well as issues, concerns, and suggestions for future work.\",\"Lecturer\":\"Rolf Inge GodÃ¸y\",\"Affiliation\":\"University of Oslo, Norway\",\"SummaryWordCount\":\"113\",\"Highlights\":\"(~3:11 - 6:28) Why Study Sound-Related Actions? --> An introduction for the purpose of the lecture, the Motor Theory of Perception (which is referenced repeatedly in this talk; please reference 16:56 - 19:56 for more details on this theory and the link between movement and music theory), and his personal reasons related to music theory as to why he studies movement in music.(Sorry, a few seconds over three minutes, he closes with a long sentence, but it's interesting)\",\"\":\"(~1:10:03 - 1:13:00) Summary, Conclusion, and Future Work --> A nice wrap up of the concepts (motor theory - 16:56, chunking - 47:17, and coarticulation - 58:40) from this lecture, how it can be applied to music theory, its challenges, and where future work needs to be done.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"S7AOZIGP9Ys\",\"Date\":\"2008/10/16\",\"Title\":\"Slippery Rocks: A Low-Tech Percussionist Navigates the Crosscurrents of Music Technology\",\"Keywords\":\"Percussion, Music Technology, Performance Practice, Performance, Contemporary Music\",\"Topic\":\"Performance\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"Percussion and music technology have often been lumped together as \\\"new technology from the 20th century,\\\" involving the \\\"liberation\\\" or refinement of sound, and largely involving the culture of addition. In this lecture, Steven Schick talks about how concepts regarding percussion and performance might transpose into the realm of music technology. The exploratory and forward-moving thinking of music from the late 20th and early 21st century often driven by creators (such as engineers) and composers, and the process of consolidation - the creation of language and performance practice - often driven by performers is discussed. This lecture examines the role of performer and consolidation, the concept of meaningful limits, and closes with Prof. Schicks musical examples (41:17).\",\"Lecturer\":\"Steven Schick\",\"Affiliation\":\"University of California, San Diego, USA\",\"SummaryWordCount\":\"115\",\"Highlights\":\"(~4:31 - 7:46) Percussion and Music Technology --> This highlight discusses how the world of percussion might transpose into the world of music technology, as well as the concept of \\\"additive culture\\\" and the \\\"improvishment of sound\\\" - the latter two of which will be referenced for the duration of the talk. (Note: he fully finishes talking about this at 9:15, which is longer than 3 min, but what he closes with is interesting)\",\"\":\"(~32:58 - 34:18) Engagement with Technology --> In this highlight, Prof. Schick discusses what is necessary for the longevity and vitality of art, the importance of conversation between practitioners, and the important questions for performers engaging in technology (which leads into examples from Prof. Schick's performance experiences).\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\" CxFVjKMsaTc\",\"Date\":\"2009/01/22\",\"Title\":\"The voice as a musical instrument\",\"Keywords\":\"voice source, tuning formants, vocal economy, formant cluster, voice timbre, fundamental frequency, partials\",\"Topic\":\"Performance\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"How do singers produce and project their voice, doing so in a way that reaches different levels of expressivity? In a very didactic lecture, Dr. Sundberg unveils these aspects of singing. He starts with a comprehensive yet concise explanation of the physiological and acoustic components of the voice, especially the tuning formants. Following is a discussion on strategies adopted by professional singers to ensure vocal economy, like the manipulation of the first formant and the formant cluster used by female and male singers respectively. Finally, he investigates three principles associated with expressiveness: tempo changes to mark the structure, intonation variation to emphasize contrasts, and time of tone onset to reinforce important notes.\",\"Lecturer\":\"Johan Sundberg\",\"Affiliation\":\"Royal Institute of Technology, Sweden\",\"SummaryWordCount\":\"112\",\"Highlights\":\"2:48-3:32\\nListen to the single partials of a voice source\",\"\":\"29:53-32:44 \\nListen to the singerâ€™s formant cluster, also known as singerâ€™s spectrum peak, as it is used by operatic western singers.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"z_sFVFsENMg\",\"Date\":\"2009/02/19\",\"Title\":\"Tonality as a colonizing force in African musicÂ \",\"Keywords\":\"tonality, African colonization, Protestant hymn, pre-colonial African soundscape, pygmy singing, pentatonism\",\"Topic\":\"Musicology\",\"ResearchAxis\":\"Music Information Research\",\"Summary\":\"Dr. Agawu defines tonality as a â€œhierarchically organized system of relations animated by desire,â€ that, according to him, has been used as both instrument of control and creative language. His lecture is centered on the colonizing potential of forms of tonality exported to Africa mainly through the Protestant hymn, thereby affecting the soundscape of costal regions and urban locations. His discussion on the features of the imagined sound of pre-colonial Africa and the responses to European tonality includes musical excerpts from pygmy pentatonic singing, dundun drumming, art music by the composer Joshua Uzoigwe, and new traditional music. All musical examples are thoroughly analyzed, leading to a profound insight into the dynamics of tonal influences.\",\"Lecturer\":\"Kofi Agawu\",\"Affiliation\":\"Princeton University, USA\",\"SummaryWordCount\":\"114\",\"Highlights\":\"18:53-19:50 \\nListen to the pentatonic pygmy singing â€“ an example of pre-colonial African music\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"UAPEVDPvlE8\",\"Date\":\"2009/03/26\",\"Title\":\"Musical Memories in Normal and Disordered Aging\",\"Keywords\":\"Aging, Perception, Cognition, Dementia, Alzheimer's,\",\"Topic\":\"Perception\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Caregivers often report witnessing a positive effect of music on a patient with dementia. While the aging brain may face cognitive difficulties, particularly those suffering from dementia of the Alzheimer's type, normal aging patients as well as those in moderate to severe stages of dementia can exhibit preserved memory for melody and lyrics. In this talk, Professor Lola Cuddy explores the topic of music and the aging brain by speaking on approaches to studying musical memory, with a focus on melodies, the challenges of research in patients with dementia, and her own work. Various case studies and their data are examined, and a brief overview of the work done in this field is explored.\",\"Lecturer\":\"Lola Cuddy\",\"Affiliation\":\"Queen's University, Canada\",\"SummaryWordCount\":\"114\",\"Highlights\":\"(~2:14 - 5:03) Paradigms for the Study of Musical Memory --> Prof. Cuddy outlines the methods and approaches to studying musical memories, and these concepts will be repeatedly referenced for the duration of the talk. (For some general findings regarding the four paradigms mentioned here, please see 12:26 - 21:12)\",\"\":\"(~46:08 - 49:07) Concluding Comments --> A wrap up of the concepts and data examined in this talk, as well as areas and questions that are yet to be further explored and answered. (Note: worth it to go until 50:21 for the full wrap-up)\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"XLBOBMY_vDQ\",\"Date\":\"2009/04/16\",\"Title\":\"Music and emotion: Toward Computational Models of Empathy and Entrainment\",\"Keywords\":\"emotion, society, research, computation\",\"Topic\":\"Psychology\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Camurri provides a one-of-a-kind insight into the ground-breaking research he is currently conducting at Italy's University of Genoa, which involves examining the relevance of the performing arts and their potential contribution to the progression of technology and science. He has done much of his work with dancers, getting them to express various emotions through the same choreography and studying how automatic recognition programs allow us to electronically interpret their movement. With this kind of information, he is then able to extrapolate something much bigger: the understanding of empathy and synchronization between people in social environments.\",\"Lecturer\":\"Antonio Camurri\",\"Affiliation\":\"University of Genoa, Italy\",\"SummaryWordCount\":\"95\",\"Highlights\":\"13:30-14:24 One of his early research projects analyzed dance languages and the works of choreographers, to see if he could use the connection towards robotic programming. \",\"\":\"57:13-59:30 The communication and synchronization between musicians playing together in an ensemble creates a situation where emotions can be either simulated or induced, and then analyzed using measurements like eye contact and body language. \"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"UN_j04vyvS0\",\"Date\":\"2009/09/24\",\"Title\":\"Learning structures in natural sounds\",\"Keywords\":\"evolutionary biology, computer science, technology, programming\",\"Topic\":\"Biology\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Lewicki looks at the processing of sound in two facets: the digital processing and analysis of audio tracks (engineering), and the physical structure of human aural mechanisms, the ear (physiology). Because his work deals with both physics and biology, he must find a way to reconcile both familiar laws of physics as well as logic of evolutionary biology as it applies to humans. Like many others, he uses theoretical models from nature to form efficient coding theory - and eventually uses this to learn about higher-order structure. In other words, computer programming is used to analyze sets of audio data from the biological world, which can then tell us about physical structures of organisms that evolved.\",\"Lecturer\":\"Michael Lewicki\",\"Affiliation\":\"Case Western Reserve University, USA\",\"SummaryWordCount\":\"115\",\"Highlights\":\"5:08 -7:22 Extremely detailed measurements can be done by taking a specific soundwave and seeing how the human ear responds - researchers can use electrodes that measure electrical activity in response to the sound, tracing it to the auditory nerve that carries the signal up to the brain. Through this, they've been able to approximate some \\\"filters\\\" that we use to sense sound - for instance, a very loud sound will have a specific frequency wave with a slow decay.\",\"\":\"49:58 - 52:54 The most difficult part of a speech recognizer is recognizing consonants - vowels are recognized with a much higher success rate than consonants. The struggle to improve upon this has led to things like modelling impact sounds of hitting a metal bar and seeing how the waveforms differ upon each impact (natural variability) to attempt to recreate these sounds computationally.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"rn2_fFcRZlY\",\"Date\":\"2009/10/25\",\"Title\":\"The sound of orchestras and soloists as a combination of room acoustics and acoustical properties of the musical instruments\",\"Keywords\":\"acoustics, sound radiation, acoustic properties, orchestra's seating arrangement, decay, loudness, synchronicity, sound level, masking effect\",\"Topic\":\"Acoustics\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"When it comes down to understanding the resulting sound of a musical performance, Dr. Meyer shows that there is much more to be considered than what musicians usually pay attention to. The room acoustics and the acoustic properties of the instruments, he explains, have an impact on the sound impression of the listener. His lecture includes an encompassing discussion on reverberation, decay times of multiple instruments, loudness curves, synchronicity (rhythmic precision) in chamber music, and sound radiation. Based on acoustical and artistic arguments, he also addresses the differences between the German (classical) and the American orchestral seating arrangement. Lastly, he discusses the acoustic demands from the point of view of the performer and the conductor.\",\"Lecturer\":\"Jurgen Meyer\",\"Affiliation\":\"University of Music Detmold, Germany\",\"SummaryWordCount\":\"115\",\"Highlights\":\"38:05-40:52 \\nDr. Meyer uses musical examples to support an artistic argumentation in favor of the classical seating arrangement of the orchestra\",\"\":\"\"},{\"Type\":\"Seminar\",\"YouTube\":\"R5ldbfhJV3A\",\"Date\":\"2009/11/02\",\"Title\":\"From 45's to downloads\",\"Keywords\":\"record producer, development, digital music\",\"Topic\":\"Recording\",\"ResearchAxis\":\"Music Information Research\",\"Summary\":\"Phil Ramone, legendary music producer and engineer, illustrates the journey of his career from a young violinist to a successful record maker and studio owner with over 50 years of experience in the industry. Alongside his numerous stories of working with stars including Frank Sinatra and Billy Joel, he describes the process of learning his craft through apprenticeship and innovation. Despite his roots in traditional music formats, he embraces the development of digital music with positivity - it's a \\\"new beginning\\\", and he insists that future generations need to have the best music with the best sound made available.\",\"Lecturer\":\"Phil Ramone\",\"Affiliation\":\"Record producer, USA\",\"SummaryWordCount\":\"98\",\"Highlights\":\"2:45-2:55 Ramone felt attached to the fact that by limiting the capabilities of the violin to classical styles, there was much more to be discovered and used.\",\"\":\"44:28-47:28 Ramone was able to convince Frank Sinatra to record the last album of his life, a collection of duets, claiming that singing songs he had already recorded would be a completely different experience after so many years.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"VOYWnUEq7yA\",\"Date\":\"2009/11/19\",\"Title\":\"Music again: Perspectives on repetition in music\",\"Keywords\":\"repetition, analysis, perception, classical, songs\",\"Topic\":\"Analysis\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Repetition - it is a defining characteristic of music, yet this seems to be the only form of artistry where it is commonly seen and even welcomed. It's what makes music social and shareable, and allows for the creation of interpersonal cohesion - well-known nursery rhymes are sung early on by children, for example, and the familiarity of old pieces of music provides comfort and a link to past memories. Margulis talks about her intuition for why the first notes of one's favourite song might spark their excitement, and how repeating motives might exist to serve as connections to people and things in the real world - as well as differentiating and bringing attention to otherwise unnoticeable elements.\",\"Lecturer\":\"Lisa Margulis\",\"Affiliation\":\"University of Arkansas, USA\",\"SummaryWordCount\":\"114\",\"Highlights\":\"3:16-3:30 Repetition in music comes in two sorts: both within a particular piece of music, and our tendency to reexpose ourselves to the same familiar pieces of music voluntarily. It is interesting as she further notes that our enjoyment of these kinds of repetition are similarly related when examined from a cognitive science viewpoint.\",\"\":\"40:00 - 42:48 By repeating a certain segment over and over, such as in The Reaper's Song by Rameau, we are eventually forced to listen to it very carefully and break it down into smaller components that might begin to sound incoherent and nothing like the original moment. It plays with our brains' perceptions of what the sound byte originally was, and has deeper implications in things such as repeats in classical sonata form.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"Vzf19l-Ztsk\",\"Date\":\"2010/01/21\",\"Title\":\"Does Music Make You Smarter\",\"Keywords\":\"mozart effect, intellectual benefit, music lessons, psychology \",\"Topic\":\"Psychology\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"The popular theory of the â€œMozart Effectâ€ states that listening to the music of Mozart increases intellectual ability by priming the brain. Schellenberg presents research-based conclusions concerning the idea of unique intellectual benefits surrounding music listening and music lessons. His research has uncovered a â€œSchubert Effectâ€ associated with listening to the music of Schubert and even a â€œKing Effectâ€ from listening to a Stephen King audio book. Schellenberg concludes that music, among other such â€œcatalystsâ€, can affect arousal and mood, which, in turn, affects performance on intellectual tasks. Further, unlike other common out-of-school activities, music lessons are associated with small but broad intellectual benefits. \",\"Lecturer\":\"Glenn Schellenberg\",\"Affiliation\":\"University of Toronto, Canada\",\"SummaryWordCount\":\"103\",\"Highlights\":\" 1:41-2:09 The question of whether music makes one smarter is only valid if listening to music is in some way special. Continue to 2:42 to include \\\"Does exposure to music include non-musical benefits?\\\" In my opinion, this extended version is a bit less interesting.\",\"\":\"48:00-48:32 1) Like many other experiences, listening to music can change how you feel, and how you feel affects behavior, including intellectual functioning. 2) Unlike other common out-of-school activities, music lessons are associated with small but broad intellectual benefits.  \"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"wf_FfC9Uq3U\",\"Date\":\"2010/03/25\",\"Title\":\"Reverse Engineering the Violin\",\"Keywords\":\"reverse engineering, violin, instrument design\",\"Topic\":\"Musical Acoustics\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Have you ever wondered exactly why violins are made the way they are? What aspects of the modern violin lend themselves to the instrumentâ€™s sound, strength, and durability? What could we do differently were we to re-invent the violin? Woodhouse provides an engineerâ€™s perspective as he explores such questions and offers unique insight on the design and possible future re-designing of the violin. He presents the audience with a variety of considerations on details such as the impedance of materials, types of wood and glue, the use of arches, purfling, and slots (f holes) in the design of the instrument, and more.\",\"Lecturer\":\"Jim Woodhouse\",\"Affiliation\":\"Cambridge University, UK\",\"SummaryWordCount\":\"102\",\"Highlights\":\"0:24-1:50 Goal/content of the talk: reverse engineering the violin\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"qvTqte1nFf8\",\"Date\":\"2010/05/15\",\"Title\":\"Cognition and control in human-machine interaction, auditory communication, and orchestral conducting\",\"Keywords\":\"engineering, robotics, cognition, audio\",\"Topic\":\"Interaction\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"This lecture explores some of those most interesting domains of human interactions with machines, where human sciences, system sciences, and information sciences come together to create Human Machine Systems. Johannsen, who has done over 40 years of research in this discipline, describes the engineering that can be developed from the field of orchestral conducting, and the autonomy and flexibility we can learn from observing music in performance. He addresses auditory communication, both through talking with words and with other sounds or music, as tools we can use to design and improve engineering processes like air traffic control.\",\"Lecturer\":\"Gunnar Johannsen\",\"Affiliation\":\"UniversitÃ¤t Kassel, Germany\",\"SummaryWordCount\":\"97\",\"Highlights\":\"11:12 -  14:12 Control is divided into three subcategories: manual control, where human cognition is dominant and is responsible for things like tracking and action planning; supervisory control, including activities like teaching and diagnosing; and gestural control, seen in activities like conducting where manual movement controls a greater process. \",\"\":\"47:24 - 49:50 For moving robots, auditory symbols For example, a broken ascending triad would represent moving upwards in a plane for the robot, while going down would be indicated by a descending triad. Left and right movements are symbolized aurally by patterns of tones with different rhythms. The robot would use these sounds to orient itself whichever way they indicated.\"},{\"Type\":\"Student Symposium KEYNOTE\",\"YouTube\":\"pibOuaot0SE\",\"Date\":\"2010/05/27\",\"Title\":\"Interaction in the Post-Convergence Age\",\"Keywords\":\"sensors, ubiquitous computing, analog modular synthesizer, digital musical instruments\",\"Topic\":\"Interaction\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Joe Paradiso gives an extensive tour of his impressive home-made modular synthesizer studio, and presents a few of his digital musical instruments. Paradiso shares his enthusiasm, and practical insights, toward more expressive and intimate control of live electronic music. Although much of his work starts in a musical context, Paradiso shares some of the ways in which the technological material of his digital musical instruments comes to be used in other sometimes unexpected places.\",\"Lecturer\":\"Joe Paradiso\",\"Affiliation\":\"Massachusetts Institute of Technology Media Lab, USA\",\"SummaryWordCount\":\"74\",\"Highlights\":\"5:40 - 6:36 (56s) Paradiso makes a connection between his work with high energy particle accelerators and his later work with sensor networks and digital musical instruments\",\"\":\"50:53 - 54:13 (20s) sensor controlled algorithmic rave music\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"dUcNzPhZdwk\",\"Date\":\"2010/09/16\",\"Title\":\"Sound Synthesis Based on Physical Models\",\"Keywords\":\"physical modeling, vibration, synthesis\",\"Topic\":\"Musical Acoustics\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Smith offers the unique combined perspective of a professor of music and an electrical engineer, who is based in the Center for Computer Research in Music and Acoustics (CCRMA) at Stanford University. Organizing the current research in itâ€™s historical context, Smith discusses the historical roots of sound synthesis based on physical modeling dating back to Bernouli's ingenious insight into superposition of simple modes of vibration and d'Alembert's foundational superposition of traveling waves, which was essentially the first wave equation and occurred during Bach's lifetime. Beyond the history of physical modeling, Smith discusses techniques of physical modeling synthesis techniques and shares related research at CCRMA. \",\"Lecturer\":\"Julius Smith\",\"Affiliation\":\"Stanford University, USA\",\"SummaryWordCount\":\"104\",\"Highlights\":\"3:08-4:08 history/beginning of modeling\",\"\":\"1:02:32-1:03:12 and 1:03:56-1:04:13 (he got on a tangent about when Bach was born in the middle) Summary of talk content\"},{\"Type\":\"Xenakis Conference KEYNOTE\",\"YouTube\":\"P997_D4JV7c\",\"Date\":\"2010/10/01\",\"Title\":\"Xenakis: Arts/Science\",\"Keywords\":\"Iannis Xenakis, electronic music, computer music, UPIC, polytope\",\"Topic\":\"Computer Music\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"A close collaborator of Iannis Xenakis' and co-author of his last book, â€œMusic and Architecture,â€ Sharon Kanach describes the past and ongoing projects that are dedicated to the promotion and development of the Xenakian legacy. Kanach describes exciting projects across Europe and North America, especially highlighting the Xenakis Project for the Americas, which started in New York as an outreach to the general public, and the Centre Iannis Xenakis at the University of Rouen, which formed to create and preserve inventory of the composerâ€™s research and creation. Kanach calls attention to the issues which can arise when performing Xenakisâ€™s works and suggests next steps for contemporary scholars. \",\"Lecturer\":\"Sharon Kanach\",\"Affiliation\":\"Centre Iannis Xenakis, France\",\"SummaryWordCount\":\"107\",\"Highlights\":\"Description of the first site-specific re-creation of the controversial Polytope de PersÃ©polis and the concerns involved (21:10-23:15)\",\"\":\"Next steps for contemporary scholars (39:10-40:15 and 41:00-42:30)\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"O8Gn54sx_Xw\",\"Date\":\"2010/10/21\",\"Title\":\"Understanding music on the web: A Yahoo! perspective\",\"Keywords\":\"Yahoo! Research, music-information retrieval, machine learning, data ambiguity, model building\",\"Topic\":\"Music Information Retrieval\",\"ResearchAxis\":\"Music Information Research\",\"Summary\":\"In the last decades, the volume and multi-media usage of online music use has exploded. Personalized data from photos, videos, ratings, tags and posts is now abundantly available, resulting in rich yet â€œnoisyâ€, or context-dependent data. Many tools using this data for user and advertiser satisfaction are no longer adequate. In response, Yahoo! Research is developing tools to increase and improve data. Slaney details these tools and advocates for a â€œmore data winsâ€ approach to data collection, so that one can have more ways to look at, and make judgements about, data or prospective solutions. Discussion is centred around machine learning tools and model-building designed to sift through the vast swaths of data.\",\"Lecturer\":\"Malcolm Slaney\",\"Affiliation\":\"Yahoo! Research Laboratory, USA\",\"SummaryWordCount\":\"113\",\"Highlights\":\"Data labelling and using MIDI data to train HMM models for speech and music recognition (/2000/00/17).\",\"\":\"Determining music similarity by user ratings (48:10-51:10).\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"uGASpqTXz4g\",\"Date\":\"2010/11/25\",\"Title\":\"Designing musical instruments that privilege improvisation\",\"Keywords\":\"digital musical instruments, mapping, sensors, algorithmic music\",\"Topic\":\"Musical Instruments\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"In this wide ranging talk, David Wessel discusses his and his colleagues work in the design of digital musical instruments, interactive music systems, and futuristic sensor systems. From questioning what makes a digital musical instrument appropriate for live improvisation, to techniques for complex interface-to-sound mappings, to e-textiles, to loudspeaker design, and even hearing aids, Wessel's research touches on a variety of subjects and application areas. With a pragmatic focus, Wessel offers his perspective on these subjects, the guidelines he has learned for himself, and his vision of what is next to come.\",\"Lecturer\":\"David Wessel\",\"Affiliation\":\"University of California, Berkley, USA\",\"SummaryWordCount\":\"92\",\"Highlights\":\"18:05 - 19:16 (1m11s) Wessel insists on the importance of visible effort in live electronic music performance\",\"\":\"\"},{\"Type\":\"Fulbright Seminar\",\"YouTube\":\"C2XKzCQ_Uj4\",\"Date\":\"2011/01/13\",\"Title\":\"Music, gesture, and musical grammar\",\"Keywords\":\"musical gesture, musical grammar, physical gesture\",\"Topic\":\"Gesture\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Threading together music, movement, and grammar, Lawrence Zbikowski argues that musical gestures are sonic analogues of dynamic processes. Tracing the motion of a leaf falling through the air with your hand is an example of a physical gesture representing a dynamic process: everyone understands that your hand only represents the leaf, but the gesture perfectly encapsulates the motion. Zibikowski suggests that the pairing of musical and physical gestures represent dynamic processes central to human experience, forming musical grammar. Musical gestures exist in a well-defined contextâ€”meter and pitch spaceâ€”so their measurable properties can lend meaning to corresponding physical gestures.\",\"Lecturer\":\"Lawrence Zbikowski\",\"Affiliation\":\"The University of Chicago, USA\",\"SummaryWordCount\":\"100\",\"Highlights\":\"Zbikowski discusses the respective functions of langauge and music (19:10-19:51)\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"ii6VtnUVsok\",\"Date\":\"2011/02/17\",\"Title\":\"Building Musical Minds in 18th Century Naples\",\"Keywords\":\"schemata, musical patterns, 18th century composition\",\"Topic\":\"Composition\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"Beginning with the conservatory tradition of 18th century Naples, Robert Gjerdingen discusses the use of schemata in improvisation and composition. Schemata are stock harmonic patterns, a lexicon of solfegi melodies and partimenti bass patterns that permeated 18th and 19th century music. Learning the schemata allows practitioners to build a phrasacon of musical idioms, and gain an understanding of the collocation (how the material fits together) and appropriate frequency of the different patterns. In this tradition, practitioners learn a corpus of coherent utterances, as to not only grasp the mechanics of the patterns, but learn the style of the musical tradition.\",\"Lecturer\":\"Robert Gjerdingen\",\"Affiliation\":\"Northwestern University, USA\",\"SummaryWordCount\":\"100\",\"Highlights\":\"Gjerdingen compares stock pattern composition in the 18th century to ice-skating routines, as listeners expected these patterns to occur over the course of the composition (23:10-24:17).\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"nOv30rHV7Ds\",\"Date\":\"2011/03/17\",\"Title\":\"Music is Meant to be Heard: Perception is Central in (my) Computer Music\",\"Keywords\":\"psychoacoustics, perception, computer music, sound synthesis\",\"Topic\":\"Perception\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"The current capabilities of technology, combined with the present progress in research, provides composers with an expanded sonic realm. Pioneering contributor to computer music, Risset, explores the possibilities of computer sound synthesis in composition. Beyond this topic, he delves into the psychoacoustics of sound: how we interpret what we hear. Risset shares how modern computer sound synthesis has ushered in new and varied possibilities that are increasingly congenial to our senses. As Risset proposes, there seems to be an aspect of magic in music that can be enhanced by using the somewhat extreme features of perception involved in synthesis.\",\"Lecturer\":\"Jean-Claude Risset\",\"Affiliation\":\"Laboratoire de MÃ©canique et d'Acoustique, France\",\"SummaryWordCount\":\"99\",\"Highlights\":\"3:31-5:03 history of synthesis\",\"\":\"1:25:06-1:26:15 closing statements and mention of the magic in music\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"6B4CsSwAyqE\",\"Date\":\"2011/04/15\",\"Title\":\"The Compositional Control of Sound Synthesis: from Traiettoria to OMChroma\",\"Keywords\":\"composition, sound perception, cognition, tone, synthesis\",\"Topic\":\"Composition\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"Synthesis - it's not just about making sound, but rather a way of thinking and hearing, and being sensitive to time. This is what Marco Stroppa has done a lot of thinking about, and he has spent his research work experimenting with acoustic piano sounds and their resonances - and also the complex process of digitalized composing not with these exact sonorities but unique ones inspired by them. As a composer with much experience and knowledge in piano techniques and instrumentation, he dives into the technical details of creating \\\"pure\\\" and \\\"noisy\\\" tone, as well as artistic lines and creativity. Compositionally, he gives the possibilities and choices of sound synthesis and cognition a great deal of consideration.\",\"Lecturer\":\"Marco Stroppa\",\"Affiliation\":\"Musikhochschule, Stuttgart, Germany\",\"SummaryWordCount\":\"114\",\"Highlights\":\"9:00-9:13  \\\"Perceptual digression\\\", or how a listener would perceive sound, is determined by two factors: to be stable, the data must be coherent and sufficient. If there is too much data (audio or otherwise), it is simply just perceived as noise.\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"F-QNEviNkKw\",\"Date\":\"2011/04/21\",\"Title\":\"Relations between linguistic and nonlinguistic sound systems: Emprical studies\",\"Keywords\":\"timbre, tabla drumming, non-lingusitic systems\",\"Topic\":\"Perception\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Neurolinguist Ani Patel argues that in the North Indian tabla drumming tradition, there exists non-linguistic symbiotic relationship between the drum timbres and bols, syllables used to vocalize a drum stroke. Each stroke is created quasi-linguistically via variation in place and manner of articulation, and each bol represents a stroke. Patel argues that bols are a case of â€œsound symbolismâ€: in tabla drumming, musical timbres are both reflective by and reflective of speech timbres. Using empirical data, Patel suggests that for experienced drummers, the areas of the brain know to be activated by speech would also be activated by tabla timbres.\",\"Lecturer\":\"Ani Patel\",\"Affiliation\":\"The Neurosciences Institute, USA\",\"SummaryWordCount\":\"100\",\"Highlights\":\"Tabla drummers use different drum strokes to create distinct timbres (8:47-10:17).\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"0ClNpyKVXpM\",\"Date\":\"2011/01/09\",\"Title\":\"Facial and Bodily Gesture in Musical Rehearsal and Performance\",\"Keywords\":\"movement, expression, gesture\",\"Topic\":\"Gesture\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Davidson explores the link between biomechanics and musical structure: \\\"How do biomechanical requirements interface with the model of musical performance?\\\" Her research grapples with the use of motion in musical expressivity during musical performance as evaluated by musicians and non-musicians. Is there an expressive repertoire of gestures, and if so, how are they used? Her research suggests that musicians develop a personal musical movement repertoire within a socio-cultural context. Beyond discussing this repertoire of expressive movements and how it is put into use, Davidson invites us to consider what social studies can add to this discussion.\",\"Lecturer\":\"Jane Davidson\",\"Affiliation\":\"University of Western Australia, Australia\",\"SummaryWordCount\":\"96\",\"Highlights\":\"40:33-41:44 there is a rep of gesture unique to each indiv, gov by socialcultural rules or 40:35-\",\"\":\"1:02:07-1:02:45 The evolution of her research focus over time.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"DTXyxdeTAnM\",\"Date\":\"2011/10/27\",\"Title\":\"Between art and science: Studying music as performance\",\"Keywords\":\"music performance, musicology, schenkerian analysis, performance style, close listening\",\"Topic\":\"Analysis\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"How can art and science mutually inform one another? Watch how Dr. Cook answers this question with an approach that combines empirical methodologies and cultural interpretations. Using Schubertâ€™s impromptu Op. 90 nÂº3 and Chopinâ€™s Mazurka Op. 63, he explains how close listening of recordings \\\"can open up a dimension to which both music theory and music psychology are insensitive, which is that of historical change\\\". The lecture includes one of the first schenkerian analysis made by Schenker himself, and new analytical techniques capable of extracting timing and dynamic information. Results show that phrase-arching elements are subjective to historical change, yet data is still insufficient to establish a performance style as a historical entity.\",\"Lecturer\":\"Nicholas Cook\",\"Affiliation\":\"University of Cambridge, UK\",\"SummaryWordCount\":\"113\",\"Highlights\":\"6:53-8:07\\nThe undiscussed historical dimension of schenkerian's performance pedagogy\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"cNxutfofwCs\",\"Date\":\"2012/01/19\",\"Title\":\"Of pipes and patches: Making music on the augmented organ\",\"Keywords\":\"organ, augmented instruments, video agumentation\",\"Topic\":\"Musical Instruments\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Church organs are immobile instruments, built specifically for the acoustics of their church. Dâ€™Alessandro discusses the challenges of augmenting a church organ with electronics for live-electronic performances. Each instrument is voiced for the room, meaning that each of the pipes is carefully balanced with one another to create the desired sound in the hall. In order to augment the instrument electronically, dâ€™Alessandro captured the sound inside of the pipes. He discusses how he used that signal to alter the sound in the hall through various effects and how he used the signal visually, as projected lights onto the pipes.\",\"Lecturer\":\"Christophe d'Alessandro\",\"Affiliation\":\"CNRS, France\",\"SummaryWordCount\":\"99\",\"Highlights\":\"D'Allesandro discusses methods of digital augmentation of the organ (24:19-28:28).\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"gfXM1Q7d6Bk\",\"Date\":\"2012/02/16\",\"Title\":\"Large-scale music audio analysis: E-science or e-musicology?\",\"Keywords\":\"MIR, music information retrieval, audio analysis, ground-truth\",\"Topic\":\"Music Information Retrieval\",\"ResearchAxis\":\"Music Information Research\",\"Summary\":\"Music information retrieval (MIR) started in the 60's but endless discussions on how to convert music scores into formats that computers could process nearly extinguished the research area. With the advent of audio formats such as mp3 and hard drives with increased storage capacity, new possibilities emerged. Electrical engineers and computer scientists started working on new ways to analyze music. Dr. Downie is a key figure in the evolution of this interdisciplinary science, involved in several initiatives that were responsible for the advancement of large-scale music audio analysis. Developing tools to identify form, structure, and classification of music, this resource empowers musicologists to approach their work in unprecedented ways.\",\"Lecturer\":\"J. Stephen Downie\",\"Affiliation\":\"University of Illinois, USA\",\"SummaryWordCount\":\"109\",\"Highlights\":\"52:32-54:08\\nHow do engineers use algorithms to deduce structure in music?\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"pDQXYyKP1BY\",\"Date\":\"2013/02/12\",\"Title\":\"Kinematics of Music Cognition\",\"Keywords\":\"movement, dance, personality, gender\",\"Topic\":\"Perception\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Even from infanthood, humans have a predisposition to move in response to music. Toiviainen discusses how the presence of a regular beat promotes activity in the motor areas of the brain and demonstrates a view of brain regional activity during music listening. Other topics presented include embodiments of meter in music induced movement (MIM), musical characteristics and MIM, listener characteristics and MIM, and perception of MIM. His findings suggest the metric hierarchies that exists in music are embedded in MIM. Characteristics of the music, such as pulse clarity and the emotional quality of the music tend to produce corresponding movements. MIM also encodes personality traits, emotion, and gender.  \",\"Lecturer\":\"Petri Toiviainen\",\"Affiliation\":\"University of JyvÃ¤skylÃ¤, Finland\",\"SummaryWordCount\":\"108\",\"Highlights\":\"12:27- 13:04Four music induced movement research topics he has pursued. \",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"06TErgm_iZg\",\"Date\":\"2013/11/14\",\"Title\":\"Drawing sounds, listening to images: The art of time-frequency analysis\",\"Keywords\":\"time-frequency analysis, DSP, music technology, mathematics, Fourier transform\",\"Topic\":\"Analysis\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"In this lecture, Patrick Flandrin highlights how time-frequency analysis lies at the intersection between physics, computer science and mathematics. He presents a plethora of approaches to signal analysis and reconstruction that are based on models that range from microphysical (quantum mechanics) to astrophysical (gravitational waves). Throughout this lecture, Mr. Flandrin compares various functions and explains specific applications for each.\",\"Lecturer\":\"Patrick Flandrin\",\"Affiliation\":\"CNRS & Ecole Normale SupÃ©rieure de Lyon, France\",\"SummaryWordCount\":\"59\",\"Highlights\":\"[16:56 - 18:05] The basic framework for analysing music notation\",\"\":\"\"},{\"Type\":\"Student Symposium KEYNOTE\",\"YouTube\":\"GtSCVqIDl-k\",\"Date\":\"2012/05/23\",\"Title\":\"On the Psycholophysics of Musical Expressivity\",\"Keywords\":\"Expressivity, Psycophysics, autism, Psycophysical expressivity curve, Disklavier, MIDI, Piano performance, Piano expressivity.\",\"Topic\":\"Psychology\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Daniel Levitin and his team explore ways to quantify the expressivity of a musical performance. With the help of Yamaha's Disklavier,  Daniel and his team artifically produce less expressive versions of musical excerpts. These are then rated for expressivity in a controlled study. Daniel and his team observe various trends that connect expressive performance to variations in dynamics and timing of the performance. Further investigations show that beyond a point, the variation doesn't continue to translate into an expressive quality. The team also explores the same conditions in autistic children, where the study shows that people with autism are unable to determine expressivity in performances from timing and dynamic variation.\",\"Lecturer\":\"Daniel Levitin\",\"Affiliation\":\"McGill University, Canada\",\"SummaryWordCount\":\"110\",\"Highlights\":\"18:16 - 19:58: Illustration of stripping away expressivity from an expressive excerpt, using the Yamaha Disklavier technology. Sonic excerpts allow one to gain a first hand insight into how the test was performed.\",\"\":\"36:04 - 36:45: Superimposing results of non-autistic listeners to autistic listeners yields interesting results which gives reason to believe that autistic listeners don't respond to the same emotional/expressive cues in music in comparison to the average listener.\"},{\"Type\":\"Student Symposium KEYNOTE\",\"YouTube\":\"ZLACjtOpe0Q\",\"Date\":\"2012/05/23\",\"Title\":\"Design Choices for Computer Instruments and Computer Compositional Tools\",\"Keywords\":\"Design Philosophies, PureData, Max, Max/MSP, Miller Puckette, Live Performance, Ableton, Computer Music, Computer Music Tools, Design environments\",\"Topic\":\"Computer Music\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Early music technology pioneer, Miller Puckette, extrapolates from his experiences in creating the widely acclaimed  environments Max and PureData as music processing tools. While addressing the longevity of such tools, amidst the evergrowing number of new environments, which are largely similar in their capabilities. Stressing on the futility of developing more of such environments, he compells for a shift away from the composer-centric nature of the existing tools, by harnessing more recent technological advancements. On that subject, Miller highlights the absense of a holistic musical programming language that would incorporate the needs of modern music composers, and incorporates the technological robustness of a language like C.\",\"Lecturer\":\"Miller Puckette\",\"Affiliation\":\"University of California, San Diego, USA\",\"SummaryWordCount\":\"105\",\"Highlights\":\"14:11 - 17:16: The role of Electronic Music Tools described as an evolution in time, from once seemingly obvious to growingly opaque. This leads up to the question of redundancy in the music programming environments that already exist today.\",\"\":\"37:50 - 39:40: Miller explores the need to explore possible units which could be coded as primitives in the existing design environments so as to implement higher level algorithms into units that can encapsulate a high dimension of sonic possibilities into being controlled or affected through a low dimension of inputs.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"8e6R1NFk2qM\",\"Date\":\"2012/09/21\",\"Title\":\"The relationship between musical notation and performance after 1950: Historical survey and theoretical considerations\",\"Keywords\":\"musical notation, John Cage, Mario Bertoncini, electronic music, experimental composition, sign and musical sound,\",\"Topic\":\"Composition\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"In the second half of the 20th century, new forms of musical notation emerged in experimental compositions. The relationship between sign and sound was affected by new extended acoustic possibilities. Composers saw an opportunity to have an exact sonic representation of their musical ideas without any written notation. For the first time, music could be inscribed instead of prescribed. Interestingly, music scores continued to be used. Dr. Borio explains this â€œÃ©critureâ€ paradigm in this two-part lecture on the underlying philosophical reasons in the evolution of musical writing. The second part is dedicated to the contributions of Mario Bertoncini on the advancement of John Cageâ€™s multidimensional use of signs, including a live performance by Bertoncini himself.\",\"Lecturer\":\"Gianmario Borio\",\"Affiliation\":\"University of Pavia, Italy\",\"SummaryWordCount\":\"115\",\"Highlights\":\"30:00-32:00\\nMario Bertoncini's live performance of one of his experimental compositions for piano solo.\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"yqrsL6fntkQ\",\"Date\":\"2012/11/22\",\"Title\":\"Imitating Stradivarius\",\"Keywords\":\"violin, Guarneri, tone replication, electronic violin\",\"Topic\":\"Musical Acoustics\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"There is a substantial difference in tone quality between a novice playing the piano and playing the violin; while you can hear the quality of the piano regardless, you will not hear the capabilities of a violin unless it is played with skill. This is but one of the reasons why the sounds the violin produces are fascinating to study. Weinreich has explored borrowing sound from a standard violin and imitating it on an electronic violin. He shares his research on violin sound waves and his technique of gathering sound samples from violins, such as the Guarneri Del Gesu \\\"Vieuxtemps\\\", and replicating their characteristics.\",\"Lecturer\":\"Gabriel Weinreich\",\"Affiliation\":\"Universtiy of Michigan, USA\",\"SummaryWordCount\":\"104\",\"Highlights\":\"3:29-5:25 What distinguishes a musical instrument\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"DPsPKQ1YSO0\",\"Date\":\"2012/12/06\",\"Title\":\"Putting Together The Puzzle of Multisensory Perception\",\"Keywords\":\"Perception, multisensory perception, haptic feedback\",\"Topic\":\"Perception\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"The world is full of sensory information - sight, sound, touch, taste, and smell - that our brain must make sense of in order to interact with the world. But what does this process look like and what happens when we are fed noisy, conflicting information? In this talk, Marc Ernst discusses the brain's integration of information from multiple senses, what affects our learning rate when faced with new or conflicting information, and how we calibrate our sensory systems in natural environments. This talk investigates these topics by looking at experiments in laboratory environments, and closes by applying these findings to a real-world situation that asks: Do people really walk in circles when lost in the desert?\",\"Lecturer\":\"Marc Ernst\",\"Affiliation\":\"Bielefeld University, Germany\",\"SummaryWordCount\":\"115\",\"Highlights\":\"(~8:46 - 12:06, a little more than 3 min, could also end around 10:40, because it gets pretty technical after that) What Would Be the Optimal Way to Integrate Information? --> A look into some data that explains how the brain tends to weigh multiple sources of information from different senses, and what it does when one of the information sources is \\\"noisy\\\".\",\"\":\"Not really a \\\"highlight\\\", but the anecdote of \\\"do people really walk around in circles when lost in the desert?\\\" starts at around ~41:45 and goes pretty much till the end of the lecture. It is quite long (because they did three experiments with it), but it's an interesting look at real-world applications of the concepts Ernst discusses in a way that's easier for people with little to no perception background to follow, and is also fairly humourous.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"PFzy_5RVqF4\",\"Date\":\"2013/01/17\",\"Title\":\"Topology of musical data\",\"Keywords\":\"topology of data, music theory, musical similarity, music information retreival\",\"Topic\":\"Music Information Retrieval\",\"ResearchAxis\":\"Music Information Research\",\"Summary\":\"If every piece of music is considered to be a point in the Euclidean space of all possible pieces, what generalizations could be made about this vast cloud of points? William Sethares's talk on the topology of music considers the geometric features of musical space. Building up from notions of musical similarity or closeness based on western tonal music theory, Sethares leverages the mathematical toolbox of the topological data analysis to expose structures underlying this music.\",\"Lecturer\":\"William Sethares\",\"Affiliation\":\"University of Wisconsin, USA\",\"SummaryWordCount\":\"76\",\"Highlights\":\"0:42 - 1:38 (56s), Sethares introduces the concept of topological space and describes some of the features which are of interest to a topologist\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"41cv5uPBWzg\",\"Date\":\"2013/02/21\",\"Title\":\"Music, Memories, and the Brain\",\"Keywords\":\"Cognitive pyschology, cognitive neuroscience,  perception\",\"Topic\":\"Psychology\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Nostalgia: one of the strongest emotions, tied with memory, that humans experience as we listen to music. In this lecture, Petr Janata examines the movement of music through tonal space using various behavioural and neuro-imaging techniques combined with computational approaches. These methods are used to try to understand how we process tonality, and how it links to a strong experience of music-evoked autobiographical memories. While there are multiple brain areas that interact when memories are experienced with music-listening, the challenge lies in examining how these interactions combine to structure our experience. The first half of this talk focuses more on concepts found in cognitive science/psychology, while the latter half holds more universal concepts.\",\"Lecturer\":\"Petr Janata\",\"Affiliation\":\"UC Davis, USA\",\"SummaryWordCount\":\"114\",\"Highlights\":\"(~9:43 - 12:50) A Look at the Torus --> A  quick look, and audience example, of tonality and how a torus (which is repeatedly referred to in this talk) is modelled. (Note: he has some playback issues with the audio example in the first few seconds of this highlight)\",\"\":\"(~49:25 - 52:50) Tonality Tracking Responses in the Brain --> A quick rundown of the areas of the brain that are involved in tonality tracking and how it relates to memory-evoking music (iNote: it can end around 52:20,. The time I put is over 3 min, but 52:50 is when he finishes fully explaining this concept)\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"Og_V4PkrMEQ\",\"Date\":\"2013/03/21\",\"Title\":\"Violin bows and bowing - action and gestures\",\"Keywords\":\"Bow gestures, bowing, bow velocity, bow force, bow-bridge distance, Helmholtz motion\",\"Topic\":\"Gesture\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Bowing gestures are highly complex movement patterns that control the sound of a note while preparing for other musical changes. Together, they can affect tone quality, dynamic level, timbre, attack techniques, and other elements of playing. In this comprehensive lecture, theories and common beliefs among musicians are scrutinized. Using live and recorded demonstrations, Dr. Askenfelt explains how the stick-slip phenomenon, the Helmholtz circulating corner, the Schellengâ€™s triangle, and the Guettlerâ€™s triangle relate to bowing and to the coordination of bow velocity, bow-bridge distance, and bow force. The evolution of bowing studies is also discussed, including the innovative approach developed by Askenfelt to measure bowing parameters.\",\"Lecturer\":\"Anders Askenfelt\",\"Affiliation\":\"Royal Institute of Technology (KTH), Sweden\",\"SummaryWordCount\":\"105\",\"Highlights\":\"8:38-9:27\\nSimulation of Helmholtz's motion, a.k.a. the stick-slip phenomenon\",\"\":\"31:32-32:37\\nAskenfelt's technique to monitor bow-bridge distance, bow velocity, and bow force using a resistance wire.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"LBvmkXzQk48\",\"Date\":\"2013/04/18\",\"Title\":\"Distributed Creativity in Musical Performance\",\"Keywords\":\"creativity, performance, classical music\",\"Topic\":\"Performance\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"The belief that all musical performances are creative and are once-in-a-lifetime experiences is a truism. What exactly substantiates creativity? How is creativity encapsulated in a classical music performance? Is it what musicians bring to or add to the musical score? What if a score does not exist? Eric Clarke suggests that we can understand creativity in performance as an interweaving of the possibilities of a score or the cultural model, the tacit performance practices of culture, the perception-action capacities of a performer, the affordances of an instrument, the influence of recordings and other performances, and the affordances of the musical material.\",\"Lecturer\":\"Eric Clarke\",\"Affiliation\":\"Univesity of Oxford, UK\",\"SummaryWordCount\":\"101\",\"Highlights\":\"1:10-1:34 Presents content of talk\",\"\":\"49:35-50:16 The junction where creativity takes places\"},{\"Type\":\"Student Symposium KEYNOTE\",\"YouTube\":\"RAdZd4NOGfg\",\"Date\":\"2013/05/23\",\"Title\":\"A (not so) Brief History of Laptop Orchestras and Ensembles\",\"Keywords\":\"laptop orchestra, PLOrk, digital musical instruments, live electronic music\",\"Topic\":\"Computer Music\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"From early experiments with his students building a variety of digital musical instruments, to an international laptop orchestra movement, Perry Cook gives a history of laptop orchestras. Exploiting the viruosity of existing musicians, and extending musical performance through computer mediation, Cook offers a wide overview of his approach to the design of digital musical instruments, and describes the formation of PLOrk and its cousins.\",\"Lecturer\":\"Perry Cook\",\"Affiliation\":\"Princeton University, USA\",\"SummaryWordCount\":\"64\",\"Highlights\":\"7:35-7:50 (15s), Cook talks about his approach exploiting the viruosity of existing musicians, and extending musical performance through computer mediation\",\"\":\"\"},{\"Type\":\"Student Symposium KEYNOTE\",\"YouTube\":\"7GepqzENM-I\",\"Date\":\"2013/05/23\",\"Title\":\"Interactivity, shminteractivity: In search of the expressive computer\",\"Keywords\":\"interactive music, expressivity, musical gesture, computer music\",\"Topic\":\"Computer Music\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Christopher Dobrian comments on his experiences developing interactive computer music. Whereas human musicians are charismatic, creative, expressive, and lively, in order for a computer to musically interact on stage, these traits must be simulated algorithmically. Dobrian shares his frustration with this charisma gap, and some of the approaches he has taken to try to close it. How can computers be made musically expressive? When is it more appropriate to fake it? What is it that makes a musical gesture meaningful in the first place? Dobrian considers these questions and more in this exciting keynote.\",\"Lecturer\":\"Christopher Dobrian\",\"Affiliation\":\"University of California Irvine, USA\",\"SummaryWordCount\":\"94\",\"Highlights\":\"24:50 - 25:22 (32s), Dobrian talks about the gap in charsma comparing humans and computers onstage.\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"UJBq44pnUoo\",\"Date\":\"2013/09/12\",\"Title\":\"Music understanding and the future of music performance\",\"Keywords\":\"Human-computer interaction, computer music, music technology\",\"Topic\":\"Computer Music\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"Roger Dannenberg gives us an overview of human-computer interaction for music performance, and how innovation in this field could contribute to artistic expression and commercial products. Using examples of his and his colleaguesâ€™ research, he highlights the capabilities of actual computer systems for accompaniment, style classification, score alignment, onset detection and sound synthesis. Professor Dannenberg presents various research challenges in the field and finally, he talks about how building intelligent machines could re-shape the way we learn, perform and share music. Ultimately, enriching the musical experience for millions of people.\",\"Lecturer\":\"Roger Dannenberg\",\"Affiliation\":\"Carnegie Mellon University, USA\",\"SummaryWordCount\":\"91\",\"Highlights\":\"[00:47 - 01:18] It introduces the talk and sets an optimistic tone to the narrative\",\"\":\"[50:53 - 51:00] This idea wraps up the lecture, draws parallels between other art forms and computer music. It closes with an optimistic tone as the first one did.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"iQuCpLuhBWk\",\"Date\":\"2013/10/17\",\"Title\":\"Acoustics and contemporary music\",\"Keywords\":\"Wind instruments, contemporary, mechanics\",\"Topic\":\"Musical Acoustics\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"One of the most important elements of contemporary music is acoustics and novel ways of producing sound. CaussÃ© discusses the ways in which 20th-century composers integrate the mechanics behind creating sonorities into writing music that is radically different from historical genres, including mutes for brass and clarinet, microintervals (intervals smaller than a semitone), multiphonics, and virtual instruments. Many different approaches, such as the addition of devices onto an instrument, physically changing the embouchure, and the development of new techniques are explored through new methods of measurement and research. As well, software such as Modalys is now employed to explore the hybridization of acoustic and digital music making.\",\"Lecturer\":\"RenÃ© CaussÃ©\",\"Affiliation\":\"IRCAM, France\",\"SummaryWordCount\":\"107\",\"Highlights\":\"6:50 - 9:00 The microintervallic system was used by composers suchas Ligeti by employing a physical device in order to expand the capabilities of the instrument. These devices also gave way to possibilities for \\\"split personalities\\\" where an instrument was able to produce different types of sound through different methods.\",\"\":\"46:49 - 48:18 The quality of both wind and percussion instrument tone can be mathematically plotted in order to analyze aspects like sound decay and different partials of the instrument.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"i_juIZq46gI\",\"Date\":\"2013/11/14\",\"Title\":\"Semantic audio: Combining semantic web technology with audio analysis\",\"Keywords\":\"semantic audio, metadata, music analysis, music technology\",\"Topic\":\"Music Information Retrieval\",\"ResearchAxis\":\"Music Information Research\",\"Summary\":\"Mark Sandler takes us through a ten-year journey of research in the field of semantic audio. Using various project examples, he presents how this research is connecting pieces of data, information, and knowledge that surrounds the world of music. With the goal of not only extracting meaning from audio, but to be able to use it to create musical tools and experiences. Professor Sandler talks about the evolution of the field starting from expert generated metadata in applications like Pandora, the current state of content-based metadata and a look into the second generation of digital music applications that use standardized semantic metadata.\",\"Lecturer\":\"Mark Sandler\",\"Affiliation\":\"Queen Mary University London, UK\",\"SummaryWordCount\":\"104\",\"Highlights\":\"[58:05 - 01:00:32] These are the major challenges of the field, he goes into more detail during the lecture and is a good overview of the topics he talks about.\\n\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"_G68Q4gkOMc\",\"Date\":\"2014/01/23\",\"Title\":\"Spatiality in Acousmatic Music\",\"Keywords\":\"acousmatic music, music composition, spatiality, space\",\"Topic\":\"Composition\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"â€œSpatialityâ€ refers to all those factors that contribute to the experiencing of space. In this talk, Denis Smalley elaborates on his theory of spatiality, describing the way that the sounds of acousmatic music evoke transmodal physical experiences, including motion, depth, and scale. Not just related to the perceived position of a sound in space, Smalley's theory of spatiality considers the whole acousmatic \\\"image\\\", the sources implied by the sounds or imagined by the listeners, and the spectral properties of the sounds. Smalley shares insight into his approach to composition with space in his acousmatic compositions.\",\"Lecturer\":\"Denis Smalley\",\"Affiliation\":\"City University, UK\",\"SummaryWordCount\":\"95\",\"Highlights\":\"6:19-7:17 (58s), Smalley describes the way in which listening to acousmatic music is a transmodal sensory experience\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"JBhVh-yob38\",\"Date\":\"2014/03/27\",\"Title\":\"A listening tour of musical portraits and sonic landscapes\",\"Keywords\":\"sonification, collaboration, sound installation\",\"Topic\":\"Computer Music\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Chris Chafe gives an overview of his work in computer music, ranging from concert pieces to investigations about how we imagine sounds in our head. The threads involve joint work with biologists, instrument builders, neurologists, conductors, students, cargo ship captains and massive groups of online listeners. From works for musicians with fixed electronic accompaniment to real-time sonification of environmental data, Chafe's work encompasses a wide range of approaches to computer music. Some of the work is pure music, some of it part engineering and observation.\",\"Lecturer\":\"Chris Chafe\",\"Affiliation\":\"Stanford University, USA\",\"SummaryWordCount\":\"85\",\"Highlights\":\"6:37 - 7:00 (23s), Chafe identifies the thing he strives to evoke in the audience of his sound installations\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"PKpRaqjbD-g\",\"Date\":\"2014/04/17\",\"Title\":\"Music Learning Through Multiple Lenses\",\"Keywords\":\"Music Education, Learning, Teaching Methods\",\"Topic\":\"Education\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"What happens in a learner's mind that leads them to understanding, or not understanding, a concept? What leads learners to be able to do something, or not do something? How can educators change a learning environment and the way they teach to reflect what learners experience outside the classroom? In this lecture, Dr. Robert Duke speaks about important considerations for not only effective music learning, but effective learning across all disciplines. Drawing from examples such as case studies, and often from his own humorous personal experiences, Dr. Duke highlights the importance of teaching attitudinally, with room for error-making, and with clear visions and goals in order to engage students to learn deeply. \",\"Lecturer\":\"Robert Duke\",\"Affiliation\":\"University of Texas, USA\",\"SummaryWordCount\":\"112\",\"Highlights\":\"(~6:00 - 9:10) Effective Expression --> Using a popular YouTube video, Dr. Duke showcases that students, even the very young, are capable of effectively expressing themselves in music and other disiciplines (this video is also referenced through the lecture)\",\"\":\"(~37:00 - 39:44) Training Wheels --> This segment highlights how error-making contributes to a student's depth of learning, and how teachers can incorporate this into the learning environments they build.\"},{\"Type\":\"Student Symposium KEYNOTE\",\"YouTube\":\"WGnUrCNdH88\",\"Date\":\"2014/05/07\",\"Title\":\"Scordatura: on re-mapping the body to sound \",\"Keywords\":\"instrument creation, instrument modification, scordatura, electronic instrument, composition\",\"Topic\":\"Musical Instruments\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"What creative doors open when we employ scordatura to re-explore the possibilities of musical instruments? Likewise, what opportunities become available with the introduction of completely new instruments? When we remove musicians from their well-learned accustomed modes of musical performance, creative potentials are fueled. Trueman discusses his multifaceted work as a fiddler, inventor, and composer with new and reconfigured instruments. From composing with his Hardanger dâ€™Amore fiddle played with alternative tunings to inventing new musical instruments and co-founding the Princeton Laptop Orchestra, his work involves â€œleveraging and subverting existing, hard-earned embodied modes of expressionâ€ for the purpose of providing embodied creative spaces. \",\"Lecturer\":\"Dan Trueman\",\"Affiliation\":\"Princeton University, USA\",\"SummaryWordCount\":\"101\",\"Highlights\":\"2:08-2:37 goal for presentation and intro of term: scordatura.\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"GAzVZOZe2f8\",\"Date\":\"2014/09/30\",\"Title\":\"Music Recommendation and Discovery at scale\",\"Keywords\":\"music recommendation, computer programming, psychology \",\"Topic\":\"Psychology\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Douglas Eck, of Google USA, traces the evolution of musical formats from CDs to digital albums to online streaming â€“ developments shaped by the debuts of devices like iPods and iPhones. By distinguishing between the situations in which we have low and high engagement with music, he discusses the importance of smart user design and the role of neuroscientists, psychologists, and musicologists in the complex system of music recommendation. Three technical aspects are instrumental in suggesting music to listeners: collecting other usersâ€™ preferences to learn about possible similarities in music taste, the social knowledge and connections of musicians themselves, and audio signal processing that tags audio that sound similar together.\",\"Lecturer\":\"Douglas Eck\",\"Affiliation\":\"Research Scientist, Google, USA\",\"SummaryWordCount\":\"109\",\"Highlights\":\"8:01 - 8:22 Once someone starts listening to music with a service such as Spotify or Pandora, they are more likely to be drawn in and continue to branch off and listen to new music - so the way to expose music to more users is just to get them started on platforms like these.\",\"\":\"43:16 - 44:40 Auditory programs are able to analyze similar-sounding \\\"clusters\\\" of audio that may recur in the same genre of music.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"5pT5i1Fm3kw\",\"Date\":\"2014/11/13\",\"Title\":\"Growing a global business from a small factory\",\"Keywords\":\"music instrument business, guitar manufacturing, entrepreneurship, marketing\",\"Topic\":\"Business\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Robert Godin tells a story from humble beginnings building a few guitars with an ex-window maker to a global business manufacturing thousands of guitars at half a dozen factories around Canada. Godin shares some of the important lessons he has learned over the years, recounting some of the mistakes he made and some of the opportunities he took full advantage of and offering his insight into what is most important when building and selling a musical instrument. With excitement and enthusiam, Godin describes the way technology has changed his business, from online retail to robotic machinery, despite himself never owning a personal computer.\",\"Lecturer\":\"Robert Godin\",\"Affiliation\":\"Godin Guitars, Canada\",\"SummaryWordCount\":\"103\",\"Highlights\":\"18:49-19:11 (22s), Godin emphasizes that marketing an instrument as as difficult as manufacturing an instrument\",\"\":\"57:53-58:13 (20s), Godin shares his excitement for the future, talking about the incredible advances in their manufacturing processes using state of the art industrial robotics.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"T2JnSfpFJ24\",\"Date\":\"2015/02/12\",\"Title\":\"Apollo's gift and curse: Acquisition and loss of skilled movements in musicians\",\"Keywords\":\"Brain, music performance, physiology, focal distonya, expertise, music practice, performance-related musculoskeletal disease\",\"Topic\":\"Performance\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"In an interesting analogy to the mythological figures of Apollo and Marsyas, Dr. Altenmuller discusses how music can be both beneficial and harmful to brain plasticity, which is the functional and structural adaptation of the nervous system to processing of relevant stimuli. Sharing his lifework, this musician-physician highlights some of his successful studies on musicians, including some players from Berlinâ€™s Philharmonic and a French horn player without arms! With a physiological perspective, these studies encompass contrasting effects of music practice, from the motor refinement achieved with expertise to the causes, triggering factors and available treatments for focal distonya.\",\"Lecturer\":\"Eckart AltenmÃ¼ller\",\"Affiliation\":\"Hannover University of Music, Drama and Media, Germany\",\"SummaryWordCount\":\"98\",\"Highlights\":\"11:15-12:15\\nReal-time MRI of four Berlin Philharmonic players.\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"B2cWQqfCqLA\",\"Date\":\"2015/03/19\",\"Title\":\"Musicology centered design\",\"Keywords\":\"human-centered design, survey, music researchers\",\"Topic\":\"Design\",\"ResearchAxis\":\"Music Information Research\",\"Summary\":\"In this lecture, Frans Wiering discusses the long-standing discrepancy between the technological needs of musicologists and the products designed by software engineers. Attributing this mismatch to a lack of sensitivity to the needs of music researchers, Wiering advocates a â€œhuman-centeredâ€ approach to the design of new technologies. Careful study of the stakeholders lies at the center of this approach: what do musicologists do and value? Wiering provides preliminary results of a 500+ participant survey, demonstrating that music researchers are frustrated with the current design of many software packages. Engineers need to design new technology with musicologists, interactively, not for them.\",\"Lecturer\":\"Frans Wiering\",\"Affiliation\":\"Universiteit Utrecht, Netherlands\",\"SummaryWordCount\":\"100\",\"Highlights\":\"Wiering discusses the advantages of â€œhuman-centered designâ€ in interactive system design, emphasizing that this model does not presuppose an existing technology, but begins with a problem and designs the technology to solve that problem (29:19â€“30:33). \",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"zrpUDuUtxPM\",\"Date\":\"2015/04/16\",\"Title\":\"Sound reproduction â€“ art and science/opinions and facts\",\"Keywords\":\"loudspeakers, sound recording, music perception, music technology\",\"Topic\":\"Perception\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"In this lecture, Floyd Toole presents a scientific approach to sound reproduction evaluation. He talks about how subjective and technical measurements have an important relationship to psychoacoustic perception, which has a major impact on evaluation results. Mr. Toole highlights the value of repeatable tests. Using various examples, he introduces the best practices that he and his colleagues developed to ensure that the measurements are an accurate representation of a productâ€™s timbral performance. He highlights how challenges such as room acoustics can affect the listenersâ€™ perception of the product and, lastly, he shares his perception of what kind of technical information should be provided to the consumer.\",\"Lecturer\":\"Floyd Toole\",\"Affiliation\":\"Consultant to Harman International, USA\",\"SummaryWordCount\":\"106\",\"Highlights\":\"[05:54 - 8:20] He introduces the concepts that are important to listening tests and shares his personal experience as how he was introduced to these.\",\"\":\"[1:07:14 - 1:07:42] An interesting remark on how manufacturers provide technical information of their products.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"qASbgvulDSc\",\"Date\":\"2015/09/24\",\"Title\":\"Frontiers of music technologies â€“ singing synthesis and active music listening\",\"Keywords\":\"Vocaloid, VocaListener, VocaWatcher, Singing Synthesis,  Automatic Music analysis, Music undertsanding, Songle, Songrium\",\"Topic\":\"Artificial Intelligence\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Masataka Goto unveils a world of futuristic singing synthesis engines that hopes to pave the way into the world of computer-composed internet hits and virtual pop stars performing live concerts that can respond to popular preferences among audiences. In a similar context, he continues to touch on the subject of music-understanding technology centered around hypothetical scenarios in the future, where virtual singers could evoke human emotion through their musical creations, or other kafkaesque ideas like the role of a non-human audience in the future. He then continues to present music-understanding technology as a means of cataloging the infinitely growing collection of original and derivative content created by users and computers.\",\"Lecturer\":\"Masataka Goto\",\"Affiliation\":\"National Institute of Advanced Industrial Science and Technology (AIST), Japan\",\"SummaryWordCount\":\"110\",\"Highlights\":\"8:06 - 8:56: Hatsune Miku Phenomenon using virtual singing synthesis embodied by avatars as part of live concerts\",\"\":\"31:30 - 32:23: Songle - Music learning, and exploration.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"mxO_z3iJAZI\",\"Date\":\"2015/10/22\",\"Title\":\"The Future of Immersive Technologies\",\"Keywords\":\"Perception, Immersive Technology, Neuroscience\",\"Topic\":\"Immersion\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"How we interact, engage with, and perceive the world offers important insight in developing immersive technologies. In this talk, Poppy Crum, Chief Scientist at Dolby Laboratories, speaks about investigating how humans process information, biophysical reactions, and our own personalized interactions with the world to help us create holistic and more engaging immersive technologies. Existing technologies and processes are shown to illustrate the direction and potential of future immersive technology. This lecture examines the importance of explaining perception theoretically, computationally, and quantitatively in order to build immersive experiences that we can engage with that accurately represent the intent of its content's creators.  \",\"Lecturer\":\"Poppy Crum\",\"Affiliation\":\"Dolby, USA\",\"SummaryWordCount\":\"101\",\"Highlights\":\"(~9:08 - 12:03) Insight on How We Process Info using the McGurk Effect and How Perception is Malleable -- > Basic ideas and concepts from this introduction on perception will be further touched upon in later points of this talk.\",\"\":\"(1:04:20 - 1:07:25) - A Look into Dolby Atmos and Object-Based Audio --> With more and more movie theatres making a move towards Dolby Atmos, this segment highlights its technology as well as some challenges that researchers and developers still face when creating believable, immersive experiences.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"93Fa5gC1QSk\",\"Date\":\"2015/11/05\",\"Title\":\"Facing the music: Employing science and technology to enhance professional training\",\"Keywords\":\"performance anxiety, performance enhancement, physiology, practice, stress\",\"Topic\":\"Practice\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"At the Royal College of Music, the Centre for Performance Science researches ways to assess and enhance all kinds of human performance through a multidisciplinary approach. In this mission, music is the main tool to understand the effects of stress. Aaron Williamon discusses three studies on the anxiety in music performances and how physiological parameters compare in individuals before and during performance. Different sample sizes and analysis techniques are employed. Results show that the pre-performance period is the optimal for an intervention. To minimize anxiety and bridge the gap between dull practice rooms and challenging concert halls, a low-cost practice simulator is presented.\",\"Lecturer\":\"Aaron Williamon\",\"Affiliation\":\"Royal College of Music - Centre for Performance Science, UK\",\"SummaryWordCount\":\"103\",\"Highlights\":\"23:49-26:16\\nWilliamon explains why low frequency-high frequency ratio, when looking into heart rate variability, may not be the best technique to understand stress response.\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"U46X-cSRA2I\",\"Date\":\"2016/02/25\",\"Title\":\"Moving parts: On structure and chaotic actions in the design and build of my computer-based music(s)\",\"Keywords\":\"algorithmic composition, the grottesque, Max/MSP, Open Music, CNMAT, collaboration\",\"Topic\":\"Computer Music\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"Edmund Campion describes his life as a composer, and the development of his compositional approach which brings together the traditions of western music composition and new media technology. Campion describes his aesthetic tendencies and surveys a number of his projects from 25 years of work as a composer, including some of the algorithmic processes used in his composition, and briefly touching on some of the tools developed at CNMAT for artists and composers. Highlighting the importance of collaboration between artists, scientists, and engineers, Campion suggests a path forward toward new aesthetic terrains in music and art.\",\"Lecturer\":\"Edmund Campion\",\"Affiliation\":\"CNMAT, University of California at Berkley, USA\",\"SummaryWordCount\":\"96\",\"Highlights\":\"8:21-8:29 (7s), Campion mentions an uncanny valley between the interest of scientists and researchers and those of musicians and composers.\",\"\":\"1:00:59-1:01:39 (40s), Campion elaborates on this belief that \\\"collaboration is the key, and the goal is symbiosis\\\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"iwOaYxSJGqI\",\"Date\":\"2016/03/24\",\"Title\":\"Give me limits!\",\"Keywords\":\"computer music, sound recording, music production, music technology\",\"Topic\":\"Computer Music\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"Robert Henke presents two perspectives on computer based music production. The first, being the creative side, where he is the user of these technologies to aid his artistic expression. Later he explores the other, in which he is the person involved in creating these tools for others. Mr. Henke delves into how the invention of recording became a new art form in itself and has evolved to what we know as computer music. Furthermore, he talks about how music is developing and taking shape in a post-computer generation where possibilities are seemingly endless. Finally, he shares how he envisions future tools will be developed to serve new creative possibilities.\",\"Lecturer\":\"Robert Henke\",\"Affiliation\":\"Independent audiovisual installation artist and musician, Berlin, Germany\",\"SummaryWordCount\":\"109\",\"Highlights\":\"[01:58 - 3:28] He describes how music is traditionally created, during the talk he references this to contrast his argument\",\"\":\"[49:45 - 52:18] He resolves his idea of dealing with over-abundance of tools.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"4A99fAHNL50\",\"Date\":\"2016/04/21\",\"Title\":\"Virtual musical Instruments in virtual rooms - what's real at all?\\n\",\"Keywords\":\"virtual acoustics, virtual reality, simulated spaces, immersion\",\"Topic\":\"Immersion\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"In this talk, Michael VorlÃ¤nder explores the current state of virtual acoustics technology. He starts the lecture with a brief explanation of how virtual sources are generated, shaped and reproduced using computer models. Afterwards he shows how these models are applied to virtual reality content to achieve real time immersive experiences. Mr. VorlÃ¤nder demonstrates some of his immersive projects including a 3D reconstruction of the Montreux Casino in Switzerland. He finishes by talking about the challenges in the field and gives an overview of the current methods for quantifying and evaluating immersion.\",\"Lecturer\":\"Michael VorlÃ¤nder\",\"Affiliation\":\"RWTH Aachen University, Germany\",\"SummaryWordCount\":\"92\",\"Highlights\":\"[2:40 - 3:41] He explains how virtual reality representations of data can help people with non-technical background understand complex data\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"hRA0Yqfu9oM\",\"Date\":\"2016/10/20\",\"Title\":\"What Makes us Musical Animals?\",\"Keywords\":\"musicality, beat perception, beat induction, beat synchronization, relative pitch\",\"Topic\":\"Perception\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Musicality can be defined as a naturally developing set of traits based on and constrained by our cognitive and biological system, while music is a social and cultural construct built on that very musicality. Without the skills of musicality, there is no music. All humans share a predisposition for music. As stated by the hypothesis of multicomponent musicality, humans and animals may share some of the skills necessary for musicality, and other qualities may be species specific. Honing explores the components of musicality, particularly beat induction, and the question of which musical traits humans and animals share.\",\"Lecturer\":\"Henkjan Honing\",\"Affiliation\":\"University of Amersterdam, Netherlands\",\"SummaryWordCount\":\"97\",\"Highlights\":\"16:06-16:24: What are possible components of musicality and how are we studying them in animals.\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"HvmD4-5aRto\",\"Date\":\"2017/02/23\",\"Title\":\"The Instrument, the Player and the Maker\",\"Keywords\":\"Transitional flute, Musical acoustics, Instrument design \",\"Topic\":\"Musical Acoustics\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Benoit Fabre presents cumulative flute-centred research in musical acoustics that examines the relations between maker design, instrument physics, and player technique, within the context of musical purpose. He shows a new transitional flute that he has developed in conversation with the research. Fabre details the flute playerâ€™s basic task of crafting particular jet streams according to the instrumentâ€™s resonator and desired tones. He illustrates that the execution of the basic task is dependent on its musical context, where musical intention is correlated to respiratory effort and organized by time shapes, and time shapes depend on oneâ€™s musical understanding rather than technique. Further, musical line direction is closely correlated to respiratory effort, which leads Fabre to present a new hypothesis for further study.\",\"Lecturer\":\"Benoit Fabre\",\"Affiliation\":\"Sorbonne UniversitÃ©s - UPMC, France\",\"SummaryWordCount\":\"122\",\"Highlights\":\"Mirror neuron hypothesis (36:20-38:10): Explanation of a new area of study in response to the cumulative research.\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"RcCFzaaImYE\",\"Date\":\"2017/04/20\",\"Title\":\"Giving people control of our most important human senseâ€”hearing\",\"Keywords\":\"hearing, control, active manipulation, social interactions  \",\"Topic\":\"Interaction\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"In this lecture, Dan Gauger details the mechanics and motivation behind the BOSE QC30 headphones. The QC30 model allows the user to adjust the level of noise cancellation on a near-continuous scale, enabling active manipulation of their sonic environment. This technology grants total control to the user over their sense of hearing, the sense, Gauger argues, humans have the least amount of control over. Not only does this capability increase comfort and productivity, but allows complete mobility between a fully-immersive sonic environment and a â€œsocial earphoneâ€ condition that allows the user to equalize their external world, thus enriching social interactions.\",\"Lecturer\":\"Dan Gauger\",\"Affiliation\":\"BOSE, USA\",\"SummaryWordCount\":\"100\",\"Highlights\":\"Gauger posits the claim â€œhearing is our most important human senseâ€ and provides support through behavioral research, quotes from historical figures, and a powerful thought experiment posed to the audience (41:00â€“43:12). \",\"\":\"\"},{\"Type\":\"Student Symposium KEYNOTE\",\"YouTube\":\"5wCH_Y1V7cI\",\"Date\":\"2017/10/19\",\"Title\":\"Learning to live with error? Some reflections on trying to use computers to do musicology\",\"Keywords\":\"Musicology, Computational musicology, Music information Retrieval, Chroma\",\"Topic\":\"Music Information Retrieval\",\"ResearchAxis\":\"Music Information Research\",\"Summary\":\"Prof. Tim Crawford discusses his cumulative work in developing computer-based musicology tools as a basis from which future tools for musicology can be formed. Crawfordâ€™s vision was to develop tools which could allow one to find music information within a corpus, as with a librarian. Alongside an interdisciplinary music data research group, the groupâ€™s work catalysed a hybrid discipline called Music Information Retrieval. The driving force of this field is to harness tools that can search across data within a corpus. Crawford advocates the use of MIR tools within a semantic framework, thus holding the features of data in conversation with the external factors that surround them. Tools illustrated: audio searching across modern and historical recordings, and score searching across early music prints.\",\"Lecturer\":\"Tim Crawford\",\"Affiliation\":\"Computational Musicology, Goldsmiths University of London, UK\",\"SummaryWordCount\":\"123\",\"Highlights\":\"Using Chroma search to find selections of modern audio within large works (45:55-47:50).\",\"\":\"Explanation of searching for a selection of an early music score file across a corpus (57:55-1:00:00).\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"OtAbY43wRKA\",\"Date\":\"2017/10/19\",\"Title\":\"Recital Halls, Rehearsal Rooms, and Research Spaces\",\"Keywords\":\"Acoustics, Room Design, Acoustic Treatment\",\"Topic\":\"Acoustics\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"With certain intended room purposes come challenges and factors that acousticians, consultants, and architects must consider when designing a space. In this distinguished lecture, Joseph Myers of Kirkegaard Associates offers an introduction to room acoustics and focuses on three types of spaces: those used for performance, rehearsal, and research. Using examples, Myers explains design considerations catered to each space regarding reflections, room treatment, sound colour, and reverberation. The talk closes with the design plans for McGill University's Multi Media Room (MMR), a space intended for performance, rehearsal, and research.\",\"Lecturer\":\"Joseph Myers\",\"Affiliation\":\"Kirkegaard Associates, USA\",\"SummaryWordCount\":\"89\",\"Highlights\":\"(~8:40 - 11:51) Introduction to Sound and Acoustics -- > Concepts introduced in this quick overview of sound and acoustics will be later expanded on and applied to designing a room.\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"5SqIRTyVQgg\",\"Date\":\"2017/11/09\",\"Title\":\"YAMAHA's musical instruments and audio products as DSP applications\",\"Keywords\":\"instrument design, product design, music technology\",\"Topic\":\"Musical Instruments\",\"ResearchAxis\":\"Instruments, Devices and Systems\",\"Summary\":\"Toshifumi Kunimoto talks about his career, dedicated to designing groundbreaking instruments for Yamaha. He presents a four decade retrospective of his work, highlighting the challenges that were encountered with each of the projects he worked on. After explaining how these ideas were developed, he evaluates each instrumentâ€™s strengths and weaknesses regarding sound, playability, user enjoyment, development time and cost. He concludes his lecture by highlighting the various approaches that can be taken to design a successful product.\",\"Lecturer\":\"Toshifumi Kunimoto\",\"Affiliation\":\"YAMAHA, Japan\",\"SummaryWordCount\":\"77\",\"Highlights\":\"[02:22 - 04:30] A very basic and friendly introduction to the concepts behind synthesis methods\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"HvXMnRU96_E\",\"Date\":\"2017/12/13\",\"Title\":\"Recombinant Music: Generative Approaches\",\"Keywords\":\"allegorical, recombinant, architecture, generative music, re-embodied intelligence, computational creativity, interactive art installations,\",\"Topic\":\"Artificial Intelligence\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"The talk weaves together some of the previous works of the speaker, Bill Seaman, in collaborations with other renowned artists such as Pauline Oliveros, Sonke Johnsen, etc., and their efforts to produce artwork by recombining  elements from other artworks. The works presented are primarily interactive art installations and compositions that were born of strategic recombinations of media forms like music (or sound), image, speech and text, done in real-time with the help of generative techniques and artifical intelligence machines.\",\"Lecturer\":\"Bill Seaman\",\"Affiliation\":\"Duke Trinity College of Arts and Sciences, USA\",\"SummaryWordCount\":\"79\",\"Highlights\":\"5:37 - 6:32: Using AI in collaboration with John Supko\",\"\":\"21:56 - 22:49, 25:00 - Machines creating art.\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"SyixalrH7xo\",\"Date\":\"2018/01/02\",\"Title\":\"Composing the real\",\"Keywords\":\"extended vocal techniques, electro-acoustics, sound morphing, sonic qualities\",\"Topic\":\"Composition\",\"ResearchAxis\":\"Expanded Musical Practice\",\"Summary\":\"Trevor Wishart writes music using speech but in a unique and unconventional way. Instead of focusing on the narrative content he studies the sonic qualities of syllables from multiple languages and manipulates them aiming for a balance between technical and musical aesthetic exploration. Through the morphing of the voice he is then able to mimic the sound of bees or even bells. In his lecture, he shares these creative and compositional processes as well as many excerpts of his music. The details include challenges with collecting material for his compositions, some rather funny anecdotes, and the software programming he does himself in order to accomplish his musical ideas.  \",\"Lecturer\":\"Trevor Wishart\",\"Affiliation\":\"Composer & Performer, UK\",\"SummaryWordCount\":\"108\",\"Highlights\":\"4:08-4:58 \\nExcerpt from a piece that uses the subharmonic of the voice and morphs it into the sound of bees.\",\"\":\"\"},{\"Type\":\"Distinguished Lecture\",\"YouTube\":\"dQt1yPeyV38\",\"Date\":\"2018/03/15\",\"Title\":\"Gesture: a Language to Sense, Express, Control\",\"Keywords\":\"sing language,  theater, musical gestures, avatar, motion capture\",\"Topic\":\"Gesture\",\"ResearchAxis\":\"Cognition, Perception and Movement\",\"Summary\":\"Gesture is used as a means of communication in a variety of circumstances, however deeper knowledge of the mapping that occurs between the language units and the motion is required. Gibet proposes a perception/production approach for explaining motion and language production/comprehension related to sign language, theater, and musical gestures. She offers a methodological approach for the extraction of meaningful components of motion in the decoding process and use of these components to re-synthesize motion in the encoding process. Beyond this, Gibet describes the tools developed for specific analysis/synthesis models adapted to gestures: avatar technology as well as the synthesis models and methods employed.\",\"Lecturer\":\"Sylvie Gibet\",\"Affiliation\":\"University of South Brittany, France\",\"SummaryWordCount\":\"103\",\"Highlights\":\"0:43-1:20 Overview of talk: skilled human gestures\",\"\":\"56:14-57:34: Conclusions of presentation on sign language studies, physical theator, percussion, and conducting. \"},{\"Type\":\"\"}]\n\n//# sourceURL=webpack:///./src/data.csv?");

